// else enter the value, regardless of whether it's a valid ticker or not
function getDashboard(value){
    console.log(value);
    var ticker = getSymbolFromCompanyName(value);
    if (ticker == "Symbol could not be found!") {
      ticker = value;
    }
    window.location = 'dashboard.html?ticker=' + ticker;
}


